import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/App.css';

const Home = () => {
  return (
    <main className="work-grid">
      {/* Work items will be added here */}
      <div className="work-item">
        <Link to="#">
          <img src="/images/placeholder.jpg" alt="Artwork 1" />
          <div className="work-info">
            <h3>Artwork Title</h3>
            <p>2025</p>
            <p>Medium</p>
          </div>
        </Link>
      </div>
      <div className="work-item">
        <Link to="#">
          <img src="/images/placeholder.jpg" alt="Artwork 2" />
          <div className="work-info">
            <h3>Artwork Title</h3>
            <p>2025</p>
            <p>Medium</p>
          </div>
        </Link>
      </div>
      {/* Add more work items as needed */}
    </main>
  );
};

export default Home;
